package com.example.prescription_module.domain;import jakarta.persistence.*;import java.util.HashSet;import java.util.Set;import lombok.Getter;import lombok.Setter;@Entity@Getter@Setterpublic class Medication {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private String name;    public Medication() {    }    public Medication(String name) {        this.name = name;    }}